site.headStyle:
html {
  box-sizing: border-box;
}
*, *:before, *:after {
  box-sizing: inherit;
}
body { margin:0px; }

.boxShadow{
    box-shadow: 0px 0px 20px #00000045;
}

.input{
    padding: 5px;
}

input{
    box-shadow: inset 0px 0px 3px #0000003b;
    border: none;
    border-radius: 10px;
    height: 50px;
    overflow: hidden;
    padding: 0px 10px;
}
input:focus{
    outline: none;
}

.button{
    width: 100%;
    background-color: #ffbb00;
    box-shadow: 1px 5px 6px #ffc10069;
    height: 50px;
    border-radius: 26px;
    display: flex;
    justify-content: center;
    align-items: center;
    color: white;
}

.bullet{
    background-color: #ffffff40;
    padding: 10px;
    border-radius: 30px;
    backdrop-filter: blur(10px);
    color: white;
    display: flex;
    align-content: center;
    align-items: center;
}

.overflowClip{
    overflow :hidden;
}

@media(max-width: 480px) {
.bullet{
    position: relative;
    bottom: -105px;
    left: -158px;
}
.bestOffer{
    overflow-x: auto;
    flex-wrap: nowrap !important;
    justify-content: flex-start !important;
}

.anOffer{
    min-width: 255px !important;
    margin: 0px 10px !important;
}
}

.bestOffer{
    overflow-x: auto;
    flex-wrap: nowrap !important;
    padding: 10px;
    justify-content: flex-start !important;
}
